              amount1Desired: fraction/2,
              amount0Min: 1,
              amount1Min: 1,
              recipient: 	address(this),
              deadline: block.timestamp
          });
      iNFTPositionManager(NF_POSITION_MANAGER).mint(mint_params);


    }



